  false,\n\t\"url\": null,\n\t\"notes\": \"Digital surfaces and thicknesses of selected
  hydrogeologic units of the Floridan aquifer system were developed to define an updated
  hydrogeologic framework as part of the U.S. Geological Survey Groundwater Resources
  Program. This feature class contains a line that shows the northern extent of predominantly
  limestone forming the APPZ. North of this line the APPZ is comprised mostly of highly
  permeable dolostone. South of this line the APPZ is comprised of lower-permeability
  limestone.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
